function NewsList(props) {



    return (


        <Col className='h-100 py-4' >

            <Row xs={2} md={3} className='g-4' >

                {Array.from({ length: 3 }).map((_, idx) => (
                    <Col key={idx}>
                        <Stackcard articles={props.articles} i_line={idx} />
                    </Col>
                )
